import React from "react";
import '../styles/Contact.css';




const Contact = () => {
    return(
       <div className="Contact_cont  ">
           <div className="flex flex-column items-center"> 
                <h1 className="f1 measure bb bw2  pb3"> Get In Touch</h1>
                <p className="f3 lh-copy measure tracked fw2 tc">
                 I'm currently looking for any new opportunities,
                 my inbox is always open. Whether you have a question or just
                 want to say hi, I'll try my best to get back to you!
                </p>
                <a class="Contact_button f6 grow no-underline br-pill ba ph4 pv3 mb2 dib dark-blue " href="#0">Button Text</a>
            </div>
       </div>
    )
}



export default Contact ;
